DROP TABLE IF EXISTS `image_manage`;
CREATE TABLE `image_manage` (
  `id` varchar(64) NOT NULL,
  `create_by` varchar(64) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `del_flag` varchar(64) DEFAULT '0',
  `type` varchar(64) DEFAULT NULL COMMENT '类型',
  `image1` varchar(500) DEFAULT NULL COMMENT '图片1',
  `width1` varchar(64) DEFAULT NULL COMMENT '宽1',
  `height1` varchar(64) DEFAULT NULL COMMENT '高1',
  `image2` varchar(500) DEFAULT NULL COMMENT '图片2',
  `width2` varchar(64) DEFAULT NULL COMMENT '宽2',
  `height2` varchar(64) DEFAULT NULL COMMENT '高2',
  `url` varchar(1000) DEFAULT NULL COMMENT '地址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='图片管理';

